import React from 'react';
import NavBar from '../components/NavBar'
import { Button } from '@mui/material';
import { authFetch } from '../auth/AuthFunctions'

class Home extends React.Component {

    constructor(props) {
        super(props);
        this.testProtected = this.testProtected.bind(this.testProtected);
    }

    testProtected() {
        authFetch('/api/protected').then(resp => console.log(resp));

        useEffect(() => {
            authFetch("/api/protected").then(response => {
                if (response.status === 401) {
                    console.log("Sorry you aren't authorized!")
                    return null
                }
                return response.json()
            }).then(response => {
                if (response && response.message) {
                    console.log(response.message)
                }
            });
        })
    }

    render() {
        return (
            <div>
                <NavBar />
                <h2>Home Page</h2>
                <Button onClick={this.testProtected}>Test Protected API</Button>
            </div>
        )
    }
}

export default Home;
